export default validations = {
  email: (v) =>
    v.toString().length > 2 &&
    /^([.A-Za-z0-9_-])+@([A-Za-z0-9_])+\.([A-Za-z]{2,4})+(.[A-Za-z]{2,4})?$/.test(
      v.toString()
    ),
  first_name: (v) => (v && v.toString().length > 2 ? true : false),
  last_name: (v) => (v && v.toString().length > 2 ? true : false),
  password: (v) => v && v.toString().replace(/[^0-9]g/, "") && v.length >= 9,
};
